def find_kth_highest_bt_number(N, K):
    if N < 1 and K < 1 and (K > N):
        return -1
    prev = 1
    s = set()
    for i in range(1, N + 1):
        now = i ^ prev
        s.add(now)
        prev = now
    s = list(s)
    s.sort(reverse=True)
    if K <= len(s):
        return s[K - 1]
    else:
        return -1

